import React from 'react';
import ChatBot from 'react-simple-chatbot';

const steps = [
  {
    id: '0',
    message: 'Bom dia'
  }
]
class App extends React.Component{
  render() {
    return(
      <ChatBot steps={steps}></ChatBot>
    ); 
  }
}

export default App;
